import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import { CSSTransition, TransitionGroup } from 'react-transition-group'
import './App.css';
import InputCollaborateur from './components/inputCollaborateur';
import Rh from './components/rh'
import Home from './components/home'

function App() {

  //?mail=illshaad.budureea@dgmail.fr
  const newUrl = new URL(window.location.href);
  console.log(newUrl.href, "EMAIL");
  return (
    <Router>
      <div>
        <TransitionGroup>
          <CSSTransition timeout={900} classNames='fade'>
            <Switch>
              <Route exact path='/'><Home /></Route>
              {/* <Route exact path='/redirect/:email'><Redirect /></Route> */}
              <Route exact path='/collaborateur/:nom/:prenom'><InputCollaborateur /></Route>
              <Route exact path='/rh'><Rh /></Route>
            </Switch>
          </CSSTransition>
        </TransitionGroup>
      </div>
    </Router>
  );
}

export default App;
